import React from "react";
import { BrowserRouter as Link } from "react-router-dom";

function CategoryWheel({fetchQuestions}) {
  return (
    <div>
      <h2>Click to spin the wheeffgfgl!</h2>

      <Link to="/Challenge">
        <button className="ui button" onClick={fetchQuestions}></button>
      </Link>
        <div>
            <h1>put the category here</h1> 
        </div> 
    </div>
  );
}

export default CategoryWheel
